import React, { Component } from 'react'
import "./index.css"
export default class Article extends Component {
  state={
    title:"Title1",
    author:"新京报",
    date:"2021.1.1 12:31",
    essay:"sfkfnwjfowjjcncjdwdxmcamklmsklnjhncjkana"
  }
  render() {
    const { title,author,date,essay } = this.state
    return (
      <div className='article-content'>
        <h1>{title}</h1>
        <div>
          <span className='article-meta'>{author}</span>
          &nbsp;{date}
        </div>
        <div className='essay-box'>{essay}</div>
      </div>
    )
  }
}
